-- Table structure for table `people`
--

DROP TABLE IF EXISTS `people`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `people` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '员工id',
  `name` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '姓名',
  `sex` tinyint(4) NOT NULL COMMENT '性别，1男2女',
  `type` tinyint(4) NOT NULL COMMENT '人员类别 1 审计机关 2 内审机构 3 中介机构',
  `organid` int(10) unsigned NOT NULL COMMENT '机构，与机构关联',
  `department` int(10) NOT NULL COMMENT '部门',
  `level` tinyint(4) NOT NULL COMMENT '能力等级，1A2B3C4D',
  `phone` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '手机号码',
  `email` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '邮箱',
  `passwd` char(32) COLLATE utf8mb4_bin DEFAULT NULL,
  `cardid` char(18) COLLATE utf8mb4_bin NOT NULL COMMENT '身份证号',
  `address` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '地址',
  `education` tinyint(4) NOT NULL COMMENT '学历，1中专2大专3本科4硕士研究生5博士研究生0其他',
